Elegant Angel proudly present its brand new series, Sporty Girls. Do you ever get hot and bothered watching those pretty sports stars playing tennis on TV? Or do you find yourself slack jawed gazing at those sweaty girls playing beach volleyball by the ocean? If so, this series is for you.

Jenna Haze, Rebeca Linares, Jessica Lynn, Kristina Rose, Dakoda Brookes, Phoenix Marie, Mark Ashley, Mick Blue, James Deen, Billy Glyde

